import React from "react";
import styles from "./storysection.module.css";

import Story from "../utilities/Story";
import { Container } from "@mui/material";

const Storysection = () => {
  return (
    <div>
    <Box 
      className={styles.box} 
      sx={{
        mt:7,
        display: "flex",
        flexDirection: "row",
        overflow: "hidden",
        overflowX: "scroll",



